using Components;using System;using MessagePack;using HECSFramework.Serialize;using Commands;namespace HECSFramework.Core{	[MessagePackObject, Serializable]	public struct WayComponentResolver : IResolver<WayComponent>, IResolver<WayComponentResolver,WayComponent>, IData	{		public WayComponentResolver In(ref WayComponent waycomponent)		{			return this;		}		public void Out(ref IEntity entity)		{			var local = entity.GetWayComponent();			Out(ref local);		}		public void Out(ref WayComponent waycomponent)		{		}	}}